import './SearchAndPlotVehicleValue.css';
import { useState } from 'react'
import VehicleSearchPanel from './VehicleSearchPanel/VehicleSearchPanel';
import GraphPlotOptionsPanel from './GraphPlotTools/GraphPlotOptionsPanel';


function SearchAndPlotVehicleValue() {

  const [vehicleInformation, setVehicleInformation] = useState(null);
  const [plotOptions, setPlotOptions] = useState(null);

  console.log("Root Number of Months", plotOptions);

  return (
    <div className="SearchAndPlotVehicleValue">
      <VehicleSearchPanel vehicleInformation={vehicleInformation} setVehicleInformation={setVehicleInformation}/>
      {vehicleInformation && <GraphPlotOptionsPanel plotOptions={plotOptions} setNumberOfMonths={setNumberOfMonths} />}
    </div>
  );
}

export default SearchAndPlotVehicleValue;
